class Hello extends React.Component{
            constructor(props){
                super(props);
                this.state={
                    value:""
                };
            }   
            render(){          
                return(
                    <div>
Kgs to Pounds
<div class="card text-center"><br/>
        <div>
            <input  onChange={this.changeValue}  id="#" placeholder="Kgs to Pounds" value={this.state.value}/>
            <button  onClick={this.converter_kgs_to_pounds} > In Pounds</button> <br/> <br/>    
            <button id="#1" type="button" class="btn btn-primary btn-block" >RESULT</button>      
            
        </div>        
</div>

</div>
                );
            }
            changeValue=(event)=>{
                this.setState({
                    value:event.target.input
                })
            }
            converter_kgs_to_pounds=(event)=>{
                // var i= document.getElementById("#").value;
                // i=parseFloat(i)
                var t=2.20462*this.state.value
                console.log(t)
                document.getElementById("#1").innerHTML=t;
            }     
            
        }
